import './App.css';
import RegisterForm from './components/RegisterForm';
import Loginform from './components/Loginform';
import { Route, Routes, Switch } from 'react-router-dom';
import Profile from './components/Profile';
import { useState } from 'react';
// import SideNav from './components/dashborad/SideNav';
import UsersTable from './components/dashborad/UsersTable';
import Home from './components/dashborad/Home';
import AddUser from './components/dashborad/AddUser';
import SideNav from './components/dashborad/SideNav';
function App() {
  const [id, setId] = useState('');
  const receivedData = (data) => {
    setId(data);
  };
  return (
    <div className="App">
      <div style={{ display: "flex" }}>
        <SideNav />
        {/* <Home /> */}
        <Switch>
          <Route path="/home" component={UsersTable} />
          <Route path="/adduser" component={AddUser} />
        </Switch>
      </div>
      <Routes>
        <Route path="/" element={<RegisterForm />} />
        <Route path="/login" element={<Loginform myFunc={receivedData} />} />
        <Route path="/profile" element={<Profile id={id} />} />
        {/* <Route path="/dashboard" element={<SideNav />} /> */}
        <Route path="/users" element={<UsersTable />} />
        {/* <Route path="/home" element={<Home />} /> */}
        <Route path="/adduser" element={<AddUser />} />
      </Routes>

    </div>
  );
}

export default App;
